(22, 'Food Trucks to sell only nutritional food as Breakfast, Lunch and Dinner without compromising on Taste.', '<p class=\"MsoNormal\"><u><span xss=removed>Product / Service Description:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Replacing food habits with nutritional food by preparing a variety of tasty dishes for Breakfast, Lunch and Dinner. These Dishes should contain Fruits, Vegetables along with healthy carbohydrates and fats.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Market Scope / Potential:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>We have many options to buy Junk food and very few options for nutritional food. In these days people are looking for solution to change their food habits. But they could only able to get advices.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Opportunities:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Less competition at present.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Not very huge Investment.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>No Replacement to Traditional food.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Risks:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Without compromising on Taste.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Raw material Ripe fast.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Storage time for end product is very less.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Profit Margins are not huge.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Entrepreneurial Qualities:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>An Entrepreneur should have enough experience in dealing with Fruits and Vegetables. Before Initiating into business, one should be ready with proper business plan.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Do’s:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Recipes should be prepared as per Nutritionist guidance.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>Always sell fresh food.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Don’ts:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed>No bulk purchase of Raw materials.</span></p>\r\n<p class=\"MsoNormal\"><span xss=removed>No Compramise on Taste.</span></p>\r\n<p class=\"MsoNormal\"><u><span xss=removed>Conclusion:</span></u></p>\r\n<p class=\"MsoNormal\"><span xss=removed> <span xss=removed>Nutritional food truck business is for people who has ability to handle Procurement (Buying Fruits and Vegetables), Products (Tasty Dishes) and Sales (Selling Products) simultaneously.</span></span></p>', 30, 1, 250000.00, 350000.00, 3, 25000.00, 50000.00, 2, 8, 14, 6, 2, '2018-11-01 23:13:43', '2019-03-18 18:20:15'),
(23, 'An online business to sell health supplements and multivitamins.', '<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Product/Service description</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Sell renowned health supplement and multivitamins online through Amazon. Get in touch with health supplement manufacturers, sell their products, advertise about the business in different ways like on social media, through flyers and also word of mouth.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Market Scope/potential</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">These days people are becoming more health conscious. As the quality of food is degrading and the lifestyle is becoming erratic, most of the nutritional needs are not fulfilled just by eating the normal food. So, people are in a need of different kinds of nutritional supplements that can enhance the quality of their health.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Opportunities</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">1. Online business needs less investment.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">2. The storage and transportation is handled by Amazon, though they charge a some amount for their service.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">3. Scope of the business is good because the demand of nutritional supplements is increasing day by day.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Risks</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">1. There is a lot of competition in the market so one needs to have solid advertising and convincing capabilities to attract the customers.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">2. A license is required from FDA to sell health supplements.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">3. Anything that is going to be ingested by the customers has the risk to cause reactions, so the product should be from a renowned manufacturer only.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">4. The review on the Amazon platform should always be good so as to attract more customers.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Entrepreneurial qualities</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">In order to start a health supplement business, one should definitely have a little knowledge about food supplements and vitamins. This will enable the person to keep a check on the products that he/she is selling. Apart from this, since online business is only on the internet, a good marketing is required to attract customers.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Do\'s </span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">1. Do think about specialising in the area of health supplements. A crash course can also be done to gain knowledge. If this is not possible, take the help of a person who knows about the field.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">2. Invest in quality products. Look for only genuine manufacturers.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">3. Keep the label in compliance with the FDA rules and regulations.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Don\'t</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">1. Don\'t underestimate the power of attractive labels. Ask your manufacturers to design an attractive label or leverage a label making company for it.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"EN-GB\">Conclusion</span></strong></p>\r\n<p><span lang=\"EN-GB\" xss=removed>Online health supplement business has a great scope for people who have a little knowledge in the pharmacy field. A person in this business should also have good communication skills and convincing power to put customers\' minds at rest and make them believe that the product is going to enhance their health. Marketing strategy is also one of the factors that is crucial to succeed in this business.</span></p>', 41, 1, 75000.00, 100000.00, 3, 12000.00, 18000.00, 2, 8, 12, 135, 2, '2018-11-02 03:48:51', '2019-03-18 18:20:15'),
(24, 'Make Ecommerce website and app for only farmer , buy all agriculture product', '<p>In india it is big problem of farmer they do not agriculture product online in villages and they not take best quality product in lower price so i connect all agricuture stores product online and make easy life of farmer so they have no tension which is best in simply word make as same ecommerce site such as amazon, flipkart etc but for only agriculture purpose</p>', 34, 1, 10000.00, 15000.00, 3, 999999.99, 999999.99, 2, 10000, 100000, 45, 2, '2018-11-02 21:43:43', '2019-03-18 18:20:15'),
(26, 'A vermicompost unit to manufacture vermicompost, packaging of the compost, selling vermicompost, selling the surplus culture, training other vermicomposting units.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Sell a variety of plants that can be grown in pots, seeds of vegetables and flowering plants, organic fertilizers, pesticides, gardening soil mix, homemade compost, decorative pots, gardening tools and accessories. The business will focus on the gardening requirements of apartments, offices and other small spaces.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Vermicompost is a great source of nutrition for the plants. It is much cheaper than the chemical fertilizers and a little quantity goes a long way. Moreover, since it is an organic fertilizer, it neither harms the soil nor the plants. It has a huge demand in the market due to its benefits and also because more and more people want to switch to fertilizers than do not harm the environment.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Vermicompost is easy to make and the installation of vermicompost bed does not need a lot of space.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The tools are a one-time investment.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Vermicompost takes lesser time to be made when compared to normal compost because the worms help in the faster decomposition of waste.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The life of worms is around two years and they reproduce pretty fast so there is a good amount of worms produced if proper conditions are provided.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The raw materials are kitchen waste, cow dung, paper scraps, droppings of birds, paper mill slurry, etc. These things are actually the waste that is available in huge amounts at practically no cost.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The worms can be attacked by pests.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a need to constantly keep turning the mixture and adding moisture. An optimum temperature should also be maintained.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Though the vermicompost has an earthy odour, it can start giving out an offensive odour if all the factors are not maintained properly.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">To start vermicomposting, there is no need of any kind of special training or skill. However, working with worms may not sound interesting to everyone. Therefore, this business is only for those people who have a desire to work with the worms and waste materials. In addition, one also has to have a land to prepare the vermicompost beds. Space should also be available to store the prepared compost. </span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Do\'s</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Chop the kitchen scrap into tiny bits so that it is easier for the worms to decompose them.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Keep the correct ratio of moist and dry material in the compost.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">If the compost seems to be very moist, add dry materials like paper, cartons, dry leaves, etc.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Don\'t</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t add fresh cow dung to the compost as there is a lot of heat in it. Leave it for a few days so that the heat escapes.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t add plastic, glass, metal or any kind of material that cannot be decomposed. This can spoil the quality of the compost.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t add onions, garlics or citrus fruits to the compost. Avoid salty food and meat products too.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-GB\" xss=removed>Vermicompost business is for those people who are passionate about farming worms, are ready to utilise their land to recycle waste and have the skills to sell their products in the market.</span></p>', 3, 1, 350000.00, 500000.00, 4, 300000.00, 350000.00, 2, 14, 20, 6, 2, '2018-11-03 06:00:00', '2019-03-18 18:20:15'),
(27, 'A small housekeeping business which is mainly involved in providing cleaning services to hotels.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/Service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Provide an overall cleaning solution to hotels which includes cleaning of lobby area, reception, garden, parking, swimming pool, all the rooms, washrooms, kitchen and laundry.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/ Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Hotels need to maintain an optimum level of cleanliness at all times because only a clean hotel can attract good number of guests. Therefore, all the hotels take utmost care to keep the place sparkling clean. To take care of the cleanliness, a housekeeping department is required. Many times, in order to lower the burden, hotels outsource their housekeeping services. A housekeeping business can be of a great help to such hotels.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Less capital is required to start the business.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Since cleanliness is the main criteria of any hotel, housekeeping business can flourish well.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The tools and machines to be used are a one-time investment.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is no need to rent a separate building. It can be started from a very small space, a garage or even one\'s own home. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is no need to pay any utility bill.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a great deal of competition in the market.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Making contacts and getting continuous work during the initial days can be challenging.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Maintaining the team of workers is difficult as they have a tendency to quit the job.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Regular monitoring and training is required to keep the workers motivated.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial skills</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is no skill required to start a housekeeping business. However, you need to have good communication and managerial skills. You need to build good contacts with hotels that can give you the job. Your team of workers also need to be managed efficiently.<u></u></span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Do\'s</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Look for new technology and tools that can enhance the efficiency of your work. Keep learning and keep growing.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Calculate all your expenditure and assess your cost mindfully. There is no need to undersell yourself to get work.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Value your workers. Your workers are your asset. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Invest in building good customer relationships. This is the only way to get a continuous workflow.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Don\'t</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t be careless with your work. The damage can cost you money and even make you lose a profitable contract.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Housekeeping business is seeing a boom these days. Anyone who is ready to invest a little money, has good managerial skills, takes pride in providing quality services to people and has excellent communication abilities can start this business.</span></p>', 30, 1, 500000.00, 600000.00, 3, 25000.00, 50000.00, 2, 8, 12, 6, 2, '2018-11-05 00:55:04', '2019-03-18 18:20:15'),
(28, 'To make jams and jellies on a small scale.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A small-scale business of making fresh jams and jellies from seasonal fruits.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">As the food habits are changing, most of the people are moving towards readymade food options. Jams and jellies are one of the most favourite on-the-go food items that people love to eat with breads. The commercial jams and jellies are loaded with preservatives, chemicals and sugar. A small-scale business that produces these items using authentic recipes will be much appreciated.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a high demand of organically produced authentic jams and jellies in the market.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Investment required is less.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Less space is required to set up the kitchen.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Raw materials (fruits) are easily available from the whole sellers.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Business can be easily expanded if there is an increase in the demand.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Since jams and jellies can be easily preserved, there is no hurry to sell the finished product immediately.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business gives a chance to many women entrepreneurs to start a venture of their own.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper license and registration is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The raw material (fruits) has to be processed fast as it is highly perishable.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Pricing of the product has to be done strategically so that all the costs involved are covered effectively.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Marketing should be good so as to bring in a reasonable profit.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Labelling of the product should be done clearly.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who starts jam making business must have a small space to set up the kitchen. The kitchen should be made under the rules and regulations defined by the food administration laws. The person should know the process of making the jam and preserving it. Strategic marketing is also needed to make sufficient profit.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Jam making business is small-scale business that can be started by any person who knows the skill of making the jam, and also wants to transform this skill into a business opportunity by investing only a little amount of money.</span></p>', 25, 1, 50000.00, 60000.00, 3, 20000.00, 30000.00, 2, 6, 10, 6, 2, '2018-11-05 05:58:56', '2019-03-18 18:20:15'),
(29, 'To sell white and grey cement of various brands for construction purposes.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>The business focuses on selling various brands of white and grey cement to retailers and construction sites. The shop also has the provision of the transporting the cement bags to the construction sites.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Cement business has always been a flourishing occupation in India mainly due to the ever-growing nature of the construction in our country. This is the one business that has hardly been affected by recession. Therefore, a dealership in cement is always a good idea to make a handsome profit. However, some marketing strategies need to be taken care of in order to increase the sales and run the business smoothly.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Less investment is required to establish the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Profit margin is good.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Cement is in great demand.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Competition is more, so good contacts with engineers, architects and builders is a must to do a good business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A minimum area of 500 sqft. is required to open a cement shop.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Storage should be ideal so that it does not degrade the quality of the cement.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The shop should be in an area where the cement bags can be easily loaded or unloaded from a truck.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Labourers are required to load and unload the cement bags.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>There should not be another cement dealership business in the vicinity.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business should be registered.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Anybody dealing in cement business must have an overall idea of the raw materials used for construction of buildings. He/she should also be able to manage the labourers and drivers who would help in the transportation of the cement bags. In this business, developing contacts and relationships with builders and engineers is the best way to get good sale contracts.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Cement business holds a good scope in the market, as it is one of the most important material used in the construction. Establishing this business does not require a lot of money. So, anybody who has efficient managerial skills and is good at maintaining interpersonal relationships can grab this opportunity and make the most of it.</span></p>', 12, 1, 800000.00, 999999.99, 3, 50000.00, 70000.00, 3, 2, 3, 6, 2, '2018-11-05 20:54:05', '2019-03-18 18:20:15'),
(30, 'To set up a small accounting firm that can cater to the accounting needs of individuals and other small businesses.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business aims at setting up a small accounting firm that will focus on the accounting needs (bookkeeping, tax filing and planning, financial analysis, financial advice and other specialty services) of individuals and small business organizations.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Tax filing and planning has become a necessity for every individual. However, every person is not an expert at it. An accounting firm can be of a great help in such circumstances.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Similarly, small businesses need to track their finance regularly to keep a record of their expenses. Hiring a private accountant can be expensive. Outsourcing the accounting service from an accounting firm can be a much smarter option.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The demand for accounting services is increasing, as it is mandatory for every individual or a business person to manage the finance effectively.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business has good scope of profit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business can be easily grown if the demand increases.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Less capital is required to start the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business needs to be registered.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business also needs to be insured to cover up any loss that can happen by chance.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Smart marketing strategies are required to advertise the business, for eg. flyers, personal websites, blogs, presence on social networking sites and through word of mouth.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Smart accounting software should be bought to ease out the work.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The accounting business builds with the trust of the clients, so care should be taken to deliver quality service on time.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Any person who plans to start this business should not only be an expert at accounting, but also be a smart business person. He/she should know the needs of the clients, the marketing strategies, the competitors and the importance of delivering valuable service on time.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>An accounting business deals with the finance of the people so more than anything else, it should work upon building a trustworthy environment. Good service and sufficient market research can help the business to succeed.</span></p>', 1, 1, 300000.00, 500000.00, 3, 20000.00, 50000.00, 2, 18, 24, 6, 2, '2018-11-06 02:00:28', '2019-03-18 18:20:15'),
(31, 'To rent the latest model of construction equipment to the people involved in the construction business.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service Description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business involves buying the latest construction equipment and renting them out to anyone who is involved in the construction business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market/Scope and Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The construction business in India is growing enormously because of the fast development that is taking place in the country. One of the major requirements of this business is modern equipment. Most of the people involved in the construction business do not prefer to buy any construction equipment because of the huge investment and lack of space to keep them. An occupation that deals with giving the construction equipment on rent can utilize this opportunity to build a great business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>There is a great demand for construction equipment in the market.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Since India is a developing country, construction is an ongoing process.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>It is a very profitable business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>This business is expected to grow in the years to come.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>It is a capital-intensive business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Since all the construction equipment are large in size, they occupy a lot of space.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Maintenance of these equipment is costly.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business needs to be insured.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Companies like Mahindra prove to be big competitors.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Good contacts with builders, contractors and stakeholders will help to spread the word about the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>New high-tech machines keep coming in the market, so older ones become obsolete.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business needs huge capital, so any person who can invest a lot of money can enter the business. The person should also be able to manage a team of workers and drivers who will operate the equipment. Since the competition in the market is more, good contacts and relationships with people associated with construction can help to enhance the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business to rent out construction equipment is on a rise, so it is a good idea for a person to invest in it if he/she has the required capital and the managerial skills.</span></p>', 15, 1, 999999.99, 999999.99, 3, 200000.00, 250000.00, 3, 4, 5, 6, 2, '2018-11-06 21:21:12', '2019-03-18 18:20:15'),
(32, 'To set up a preschool and day care facility to help the little kids in the neighborhood to get quality education and proper care.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business focuses on setting up a preschool in a residential area of the city. It also provides daycare facilities and after school tuitions. The curriculum is well suited to cater to needs of working parents too.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Preschool is one such field that has gained momentum in the recent years. Since the children from age 3 to 6 years are highly impressionable, it is important to give them the right kind of care and support. The initial schooling days are more about learning life skills and preschools are an expert at doing just that. Parents want their children to learn in a fun way, and feel safe and loved. A preschool that offers good facility and has a team of well trained and trusted staff can do a great business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The profit in this field is high.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Being a part of the education field helps to contribute towards the upliftment of the society.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>It is a good opportunity for people who love to spend time with children.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>It gives a lot of space for creativity.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>There is a freedom to customize the curriculum.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business needs license and registration.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Good amount of open space is required for the children to indulge in outdoor activities.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Investment required to start the business in more.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Since there is an involvement of small children, the work needs a great deal of responsibility </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Special teacher’s training is required to understand and learn the skills to handle young children.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>A preschool is more than just a business idea. It is a place where the lives of young children are moulded towards a bright future. Therefore, any person wanting to enter this business must appreciate a kid’s company. The person should have proper training on how to teach the kids in a fun way and handle their small issues. He/she must also have the required capital to start the business. Since the competition is more, marketing strategies must be right in place.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Setting up a preschool is highly profitable. Good marketing strategies will help it to grow. Proper facilities, a good team of staffs, and a safe and secure environment will attract a greater number of admissions. </span></p>', 19, 1, 999999.99, 999999.99, 4, 999999.99, 999999.99, 3, 2, 3, 6, 2, '2018-11-07 03:27:15', '2019-03-18 18:20:15'),
(33, 'To manufacture and sell handicraft products and utilize the money for the benefit of needy children.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Involving children, unemployed adults and women in making different kinds of handicraft products to be sold in the high-end stores and utilise the profit for the benefit of needy children (to provide food, clothing, housing and education)</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There are many children who are in the need of help. The NGO is usually involved in the care of these children. Apart from getting grants from big companies, the profit from handicraft business will help the NGO to raise funds for the social service. If the NGO does a good business the extra money will also help it to earn extra profit.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business is exempted from certain kinds of taxes.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Good opportunity for philanthropists to invest their money into some kind of good work.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Provides employment to many people in need.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">More profit in the business helps in the growth of the NGO and thus enables it to serve the society in a better way.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business allows other people to know about the handicrafts that has long been forgotten. Thus, it helps the rich heritage of our country to grow.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Convincing people to participate in the business is challenging.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a competition among all the NGOs to acquire the best investors so as to get maximum funds.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Merging business into NGO is a difficult thing to do. There has to be a proper business plan with good marketing and a proper board of members to take care of the business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who wants to associate an NGO with a business needs a good planning to merge the two different kinds of jobs effectively. He/she should have good communication skills and an excellent interpersonal relationship to acquire the required funds from the investors. A person who has a good experience in market research will be able to do a good business and also serve the needy.<u></u></span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">NGO has good business opportunities if the two kinds of jobs merge well with each other. It also allows people to get involved in social service and work for the upliftment of the society.</span></p>', 44, 1, 999999.99, 999999.99, 3, 60000.00, 70000.00, 3, 2, 3, 6, 2, '2018-11-07 20:47:59', '2019-03-18 18:20:15'),
(34, 'To process and produce hybrid seeds and sell them to farmers, gardeners, retailers, hobby gardeners and also through online sites.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">To obtain unprocessed raw seeds from the farmers and process them in the plant to produce hybrid seeds. These seeds will then be sold in the market to farmers, gardeners, retailers and through online sites.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Hybrid seeds are in great demand in the market because of their ability to give better produce and to withstand adverse conditions like draught and diseases. Though there are many seed processing plants, there is a scope of a lot more development in this area. Presently, since the demand is more than the supply, this business has a good scope of growth.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Agriculture is the main occupation of the people in India so good seeds are definitely in great demand for a good produce.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Hybrid seeds give better yield and are resistant to draught and diseases.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Processed seeds have better germination power.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business gives huge profits.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Less competition in the market.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The latest technology is helping in faster and better methods of seed processing.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The seed packaging should be done with special care.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Sometimes the seeds become old and lose their power to germinate properly.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Seeds might get attacked by pest or absorb humidity. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Government certification is a must.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Initial investment is huge.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Anyone entering the seed processing business must have a good knowledge of agriculture. He/she should be aware of the latest developments in the field of seed processing and biotechnology. Marketing skills should also be great so as to make effective strategies to increase the sales and thus the profit.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Seed processing business is for a person who has a good knowledge of agriculture as well as biotechnological developments. He/she should also be able to manage a big team of workers and carve out creative marketing strategies.</span></p>', 48, 1, 999999.99, 999999.99, 3, 200000.00, 250000.00, 3, 3, 5, 6, 2, '2018-11-08 02:41:13', '2019-03-18 18:20:15'),
(35, 'To start a Mid-sized gym that cater fitness needs of men and women.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product /service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A Mid-sized gym located in a busy residential area of the city with all the basic training equipment to provide service to both men and women.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market /Scope Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">More and more people have started understanding the importance of keeping fit. Apart from healthy eating, they have also started indulging in different kinds of physical activities to remain stronger, fitter and attain a great physique. In such a scenario, a Mid-sized gym located in a busy residential area and offering good fitness solutions can be a great business idea.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Since many people are becoming health enthusiasts, the business has huge opportunities.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Good profit can be earned within a short period of time if the location of the gym is good and marketing is done properly.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">It is a good business idea for people who are passionate about health and exercise because this will provide a fuel to satisfy their passion.<span xss=removed>  </span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a scope of flexibility in the work timings and also in the creativity that one can use in the gym. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Extra profit can be made by selling health supplements to the clients.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business needs huge investment.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">License is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Marketing has to be well in place or the business won\'t succeed.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There\'s a lot of competition in the market.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper space is required to start a gym. The place can be rented or bought.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who wants get into the gym business must be very passionate about health and fitness. Apart from having an adequate knowledge in this field, he/she should also have good marketing ideas, great communication skills to attract the customers, zeal to put in a lot of hard work and most importantly, a good capital to invest in the business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business is suitable for fitness enthusiasts who are passionate about providing quality health services to the people and making money by proper marketing and effective interpersonal skills.</span></p>', 66, 1, 999999.99, 999999.99, 3, 30000.00, 50000.00, 3, 4, 5, 6, 2, '2018-11-09 00:15:11', '2019-03-18 18:20:15');
INSERT INTO `ideas` (`id`, `idea_title`, `description`, `industry`, `currency`, `min_investment`, `max_investment`, `returns_type`, `min_returns`, `max_returns`, `breakeven_type`, `min_breakeven`, `max_breakeven`, `posted_by`, `status`, `created_at`, `updated_at`) VALUES
(36, 'Set up a financial advisory to advocate people about different kinds of financial investments and help them to take smart decisions.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service Description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business involves setting up of a financial advisory that can guide people to take smarter investment decisions. The business will earn money either by charging a commission on the profit earned by the person through investment or by accepting a fee for giving valuable financial advice.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The financial advisory is an untapped field in the financial market of India. People still do not want to take financial advice before making an important investment. However, the scenario is changing gradually. A newly established financial advisory will be welcomed if it works hard to build a good reputation and win over the trust of the people. This can only be possible if the financial advisor is knowledgeable in his/her field and knowns the nuances of the market.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Competition is less.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The investment required is less.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>There is a scope of earning a good profit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A financial advisor has the liberty of working at his/her own will following his/her own schedule.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business needs to be registered and a license must be obtained.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The work involves a person to work smartly in order to attract good number of clients and gain a reasonable profit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A financial advisor needs to remain updated about the happenings in the financial market.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business involves money so there is always a risk of wrong investment advice and monetary loss.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Any person who is interested in starting a financial advisory business must be a certified financial advisor. He/she must be well-versed in the current happenings of the financial market. Unique marketing strategies must be used to promote the business. An attractive website and insightful blogs will allure more clients.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Financial advisory business has a bright scope if the person entering this business has a good knowledge in the field of financial investments and knows to attract clients by using smart marketing strategies.</span></p>', 8, 1, 400000.00, 500000.00, 3, 30000.00, 50000.00, 3, 2, 2, 6, 2, '2018-11-09 04:41:17', '2019-03-18 18:20:15'),
(39, 'A retail shop to supply surgical instruments to local medical practitioners, dentists and veterinarians', '<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\"><span xss=removed> </span>A retail shop that supplies and sells different kinds of surgical instruments to the local medical practitioners, dentists and veterinarians within the city. The business also deals with free delivery of the instruments to the hospital and clinics. Special discounts would also be given for regular customers and for those who order in bulk. </span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Market Scope/ Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">With the rise in the healthcare facilities, there is a huge demand of surgical instruments in the market. Though there are many other retailers in the business that involves the supply of medical devices, there is still a scope for people who have good marketing skills, excellent contacts with medical practitioners and have good knowledge about their niche market.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Demand is more and the business is highly profitable.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">It is an evergreen market where there is always a need for more surgical instruments. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">With the advent of technology, many modern surgical devices are being introduced in the market regularly and these too have a great potential to yield profit.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Space for retail shop is needed.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Investment is huge as surgical instruments are costly.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more so smart market strategies are required to succeed in the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The instruments sold should be of high quality, as it directly affects the health of the people.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">License is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who wants to venture into the business of supplying surgical instruments must have a degree in pharmacy and should be well-acquainted with medical devices. He/she should also be a person who has good relations with healthcare providers and veterinarians around the city. Free delivery scheme is being provided so transport facility should also be available. The person should know good marketing strategies, as it is a highly competitive field.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Do\'s</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business should be registered.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There should be a proper warehouse to store the instruments.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The instruments should in no way be infected or contaminated.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">All the instruments should be properly labelled so as to keep them sorted.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A website can be maintained to advertise about the business effectively.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A good market research is required.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Don\'ts</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t sell low quality products, as it can affect the health of people.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The healthcare market is huge. Don\'t venture into everything at one time. Focus on your niche market, analyse the demands of the customers, gain their trust and then move forward one step at a time.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Though the supply business of surgical instruments has great prospects, it needs a person who is hardworking and dedicated. The person should also be able to maintain good interpersonal relationships with medical practitioners, dentists and veterinarians. A knowledge of marketing is very crucial for the growth of the business. </span></p>', 42, 1, 600000.00, 700000.00, 3, 40000.00, 50000.00, 3, 1, 2, 6, 2, '2018-11-10 02:06:30', '2019-03-18 18:20:15'),
(40, 'Transportation of perishable items within and outside the state', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service Description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>This business deals with the transportation of perishable items like milk, fruits, vegetables, meat and flowers from one place to another within and outside the state.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>With the growth of online food delivery apps, there is a growing need for instant delivery of perishable items like food, milk, milk products and flowers. Some of the food items need to be sourced from a distant location because they are unavailable at the required location. In such cases, there is a demand for transportation of these perishable items from one location to another in a short span of time, without compromising on the quality of the food items.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Since this is an upcoming business, there are no big players in the market.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Tie-up with online and retail food chains can ensure constant business cashflow.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business ensures a good profit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>It is understood that there will be a certain degree of wastage because of the nature of perishable items</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Significant capital investment is required.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Maintenance of the equipment and vehicles used for transportation is costly.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Most of the perishable goods need to be carried under a temperature-controlled environment, so the transportation vehicles must have the required facilities.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A person involved in the transportation business must understand that this job requires a great deal of responsibility and hard work. He/she should also have the required capital to invest. Being in a good relationship with the retailers, wholesalers and other customers is indispensable to ensure a continuous flow of business opportunities.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Venturing into the transportation business is a good idea if a person has the required capital, passion to put in a lot of hard work and ability to develop a good interpersonal relationship with other businesses.</span></p>', 17, 1, 999999.99, 999999.99, 3, 80000.00, 100000.00, 3, 2, 3, 6, 2, '2018-11-10 05:08:03', '2019-03-18 18:20:15'),
(41, 'Providing pest control services to places that can be easily infested by the pests. The service holds a great importance, as it helps to maintain health and hygiene.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business deals with providing pest control services to restaurants, factories, hospitals, offices and houses. It helps in controlling different kinds of pests and rodents like cockroaches, ants, mosquitoes, rats, lizards, etc.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Pest control business has become very popular lately. Since the services provided are very useful, there is an overwhelming demand for this business in cities as well as villages. Pests and rodents are notorious little creatures that can cause serious problems. Regular pest control services help them to stay under control and not cause a havoc. </span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Less investment is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>It can also be started as a part-time business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Pest control services have a great demand.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Special training is required to learn the techniques of pest control.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>As the business deals with dangerous chemicals, special license is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The pest control technicians can face health hazards if they are not careful while handling the chemicals.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>It’s beneficial if the person starting the business has a previous experience in the field of pest control. A training in this field is also mandatory. However, if the person wishes to start the business without prior knowledge in the field, he/she must hire competent staffs who are well- trained to do the job. Effective marketing skills will also contribute towards the growth of the business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Pest control business is rapidly becoming popular all over the country. Since it is also a profitable field that requires less investment, venturing into this business is a good idea.</span></p>', 24, 1, 400000.00, 500000.00, 3, 20000.00, 40000.00, 3, 1, 2, 6, 2, '2018-11-13 22:25:17', '2019-03-18 18:20:15'),
(42, 'Setting up a small-scale brewery (microbrewery) to produce different flavors of fresh beer', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>This business aims at setting up a microbrewery that prepares fresh beer in different flavors. The freshly brewed beer is free from preservatives, as it is not bottled or stored and can be had right from the barrel.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The concept of microbrewery is new in India. At present, only a few states have introduced microbreweries, however the trend is catching up soon and people are liking the taste of the authentic freshly brewed beer over the bottled variety that is mass-produced in the big breweries. Thus, setting up a microbrewery business has great prospects in the present scenario.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The beer produced is of a far better quality than the bottled ones. They do not have any preservatives and are available in several unique flavors.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>It gives a great opportunity to passionate people to craft their own beer by experimenting with different flavors.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Competition is less, as this concept is still in its infancy.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The demand of beer is increasing rapidly, as the Indian population has started appreciating it for its unique flavor.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Huge capital is required to start the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Special training is required to learn the basics of brewing.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Waste management should be planned effectively.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Proper market research needs to be done before entering into the venture.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The license and the registration might take a lot of time.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Indian government has some stringent rules to abide by when it comes to breweries and distilleries.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>People still appreciate spirit more than beer. However, the trend is changing fast.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The production of beer takes seven hours.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Anybody with an aim to start a microbrewery must be ready to invest a huge amount of capital. He/she must have the passion to create beer in unique flavors. A basic training in the field of brewing is also essential. Marketing strategies need to be perfect so as gain as much profit as possible. A visit to the already existing breweries outside India can give an idea of how a real microbrewery function.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A microbrewery has a huge business potential in the next five years but it needs a lot of capital and proper market research.</span></p>', 10, 1, 999999.99, 999999.99, 4, 999999.99, 999999.99, 3, 2, 3, 6, 2, '2018-11-14 08:19:36', '2019-03-18 18:20:15'),
(43, 'Starting a private security agency business that will focus on providing professional security services', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business focuses on starting a security agency that will provide security guards to offices, private organizations, shopping complexes, housing areas and individuals.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Since the crime in our country is rising at an alarming rate, the need of security has increased drastically. Security guards are the people who are trained to provide safety and deal with dangerous situations. These days, security guards are a common sight everywhere. They effectively fill up gaps that are created when public security or the police are unable to address a situation on time. Starting a security agency is a good way to serve the people and make some profit.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business is easy to start just with a few people.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Less investment is required.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business creates employment for people who are interested in maintaining law and order.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Once the business starts performing well, there is a scope of expanding it easily.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business should be registered, and a private security agency license must be obtained.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The security guards must be trained regularly.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Initially the profit margin is less.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Before appointing the security guards, a complete background check must be done to ensure that the person is genuine.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>This business is suitable for people who are interested in maintaining law and order. Any person who has a previous experience in the field of law enforcement can establish this business successfully. Retired personnel of army, police or air force can also start this business. Training the security guards is the main challenging task that one must take care of.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Establishing a private security agency is a good business opportunity that can be started either full-time or a part-time with less investment. Smart networking with different kinds of organizations can help in securing good deals.</span></p>', 23, 1, 400000.00, 500000.00, 4, 200000.00, 400000.00, 3, 1, 2, 6, 2, '2018-11-15 01:35:42', '2019-03-18 18:20:15'),
(44, 'Establishing a souvenir shop in a tourist area to sell unique items belonging to that place', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The souvenir shop will be in the heart of the tourist location. It will sell different gift items and mementoes that are unique to the place. It will also sell special handicraft items that will be made by the local artisans. The shop will be rustically decorated and will reflect the lifestyle and culture of that place. </span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Every tourist travel for fun, experience and memories. What better way to preserve memories than collecting unique items from that place? People love buying local items from a tourist spot. A tastefully decorated souvenir shop with an elegant display of unique items will help to attract the customers. Smart marketing and mindful pricing can help in growing the business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Initially, the business can be started small. The size of the shop does not matter much.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>What matters more is the quality of the products and the look of the shop.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The shop will represent the cultural heritage of the tourist place.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Smart marketing and a keen eye on competitors can help in doing a profitable business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The shop gives an unending scope of playing with creativity.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>There’s a lot of competition in this field.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The shop, no matter how small, must be registered.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The person should have a creative taste.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Good networking is required to attract more customers.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Knowing more than one language can help in building a good relationship with the tourists.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Any person wanting to start a souvenir shop must have the initial capital to give the place a creative look. The person should have a fine artistic taste to understand the needs of the tourists and stock exclusive items accordingly. He/she must also have the ability to attract the customers and present them with items that are memorable.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>How does the business work?</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Identify a place in a busy area of the tourist location. <u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Set up a beautifully decorated shop that reflects the culture of the place.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Stock the shop with local gift items and set the price at a minimum profit margin of 50%.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Attract travelers by offering them unique items and mementoes. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Try to keep increasing the sale gradually to break even within 1.5 – 2 years.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>A souvenir shop in a tourist location is a profitable business if the marketing is done properly. The shop will not only make money but also help to preserve the culture of the place. </span></p>', 62, 1, 400000.00, 500000.00, 3, 20000.00, 30000.00, 3, 1, 2, 6, 2, '2018-11-15 23:35:56', '2019-03-18 18:20:15'),
(45, 'Establishing a retail shop to sell women\'s fashion accessories.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A retail shop that sells fashion jewellery, sterling silver jewellery, handbags and fashion watches.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/ Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is no end to the fashion accessories that women use today. Since wearing real gold jewellery for all the occasions is not a practical idea, women have started opting for fashion jewellery which looks stylish and is reasonably priced. A business that deals in fashion jewellery and accessories can make a good profit if it offers a good variety of products.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Fashion jewellery and accessories are in huge demand.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Not much space is required to open the shop.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The fashion keeps changing so there is a lot of scope to keep adding variety to the stock.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Fashion jewellery comes in all price ranges so there is something for everyone to buy.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Not much investment is required.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Advertisement has to be done through many channels like using websites, social networking sites, flyers or word of mouth.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more so it is a smarter idea to keep an eye on what the competitors are selling.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">In order to stand out and make good sales, it is important to keep good quality of products.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">No specific skills are required to start the business, but any person planning to start this business must know about the latest fashion trends and try to stock the shop only with quality stuff. He/she should also be aware of the market competition and plan the market strategies accordingly.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-GB\" xss=removed>Fashion jewellery business has a good scope in the market if the stock in the shop is of high quality and the designs are according to the latest trends. Good market research is definitely going to help the business to grow.</span></p>', 27, 1, 300000.00, 500000.00, 3, 20000.00, 50000.00, 2, 16, 30, 6, 2, '2018-11-19 00:46:03', '2019-03-18 18:20:15'),
(46, 'Create different kinds of handmade beads and stone jewellery and sell them at various places.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business focuses on making beads and stones jewellery and selling them at jewellery shop, craft exhibitions, flea markets, to general customers, friends and family, and also online.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">These days, women love to match their jewellery with their dresses. There are different kinds of beads and stone jewellery being made for different occasions. The jewellery available at high-end fashion stores are very expensive. A person who is skilled at making customised jewellery can easily start a profitable business with little investment.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a huge demand for beads and stone jewellery.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Little investment is required.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a lot scope to add creativity and make various kinds of jewellery.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You also have the option of customising the jewellery as per demand.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There is a scope of growth if the demand increases.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more so a lot of advertisement is required to promote the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Long hours of dedicated work is required to make the jewellery. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The jewellery should be of a high quality and with a professional finish.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Profit margin is not very huge unless and until one gets a bulk order of jewellery.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Any person who wants to get into the jewellery making business should be skilled in the art of making jewellery. He/she should also be able to put in long hours of dedicated hard work in creating professional looking jewellery. </span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-GB\" xss=removed>Jewellery making is a profitable business if a person is skilled in the craft. Setting good prices for the jewellery and effective marketing can help the business to grow.</span></p>', 27, 1, 50000.00, 100000.00, 3, 5000.00, 10000.00, 2, 12, 18, 6, 2, '2018-11-19 23:35:50', '2019-03-18 18:20:15'),
(47, 'Setting up a small factory to make different flavors of authentic homemade chocolates and selling them in wholesale and retail markets.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">To establish a small factory for making authentic chocolates and supplying them to whole sellers, retailers, party organisers and for other occasions.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">There\'s no dessert more popular and convenient than chocolates. On top of that, if the chocolates are authentic homemade recipes of different flavours, their demand will always be exceeding the expectations. Therefore, a chocolate making industry is a good business opportunity.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Homemade chocolates are in high demand.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Their recipes can be customised and many new flavours, shapes and sizes can be created.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Their demand increases during festivals.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Less investment is required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper registration and license should be required to start the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The manufacturing unit needs to have adequate space and the hygiene levels should be maintained.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Special attention should be given to the packaging.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more, so effective market strategies are required to do a profitable business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Special training is required to learn the correct chocolate making process. However, presently good training institutions are scarce in India.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Any person entering into this business must learn the correct procedure of making chocolates on a large scale. He/she should also be aware of the competitors and make effective marketing strategies to gain profit.<u></u></span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Chocolate making will do a profitable business if the chocolates have distinct taste and packaging. Good business plan is very necessary to succeed in this field.</span></p>', 26, 1, 500000.00, 700000.00, 3, 30000.00, 40000.00, 2, 18, 24, 185, 2, '2018-11-22 06:51:49', '2019-03-18 18:20:15'),
(48, 'To establish a money exchange business to help people to exchange their currency.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business aims at establishing a money exchange counter in the commercial area of the city and help people in exchanging their currency at a reasonable rate.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>These days, money exchange counters can do a fairly good business because the number of people needing foreign currencies has increased significantly. The reason behind the increased demand is that people have started being involved in foreign trade more than before. The number of international holidays has also increased. A rise in the demand surely means a good scope of business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Lately, the demand of foreign currency has increased.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business does not require a great investment.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Good profit can be earned if a strong marketing plan is made and executed.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business requires very little space.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>It is mandatory to acquire a license before starting the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>Government taxes need to be paid on time.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>A detailed study of the market is required to develop marketing strategies which can yield profit.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>Location of the money exchange counter matters a lot.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>There is a lot of competition in the market.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>The business might not do well on all the days. There can be a few slow business days too, depending on the demand.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>The business might require the business person to open a merchant bank account if the transactions are more.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Any person who wants to enter into this business must understand the financial market closely. Smart marketing strategies can be incorporated to enhance the profit while also giving a good rate to the customers.  Keeping an eye on the currency fluctuation can help in maximizing the profit of the business and keep alluring the customers continuously.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Money exchange business is a good opportunity for people who understand the finance market properly. This business can mainly flourish in places where people are greatly involved in foreign trade and tourism.</span></p>', 8, 1, 800000.00, 999999.99, 3, 400000.00, 700000.00, 3, 2, 3, 186, 2, '2018-11-22 07:04:48', '2019-03-18 18:20:15'),
(49, 'Establishing a coffee shop to sell freshly made coffee along with some homemade cakes, desserts and snacks.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The coffee shop will sell hot freshly brewed coffee along with some homemade desserts, cakes and snacks which people can sit and enjoy or have on the go.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope /Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Coffee is one of the favourite beverages in India. Coffee lovers can drink it at any time of the day. This shop will provide coffee lovers with authentic freshly brewed coffee along with some homemade desserts, cakes and snacks. This food combination is perfect for an evening time with friends or even on a busy morning when one has rush to work.</span></p>\r\n<p class=\"MsoNormal\"><u><span lang=\"EN-GB\"><strong>Opportunities</strong></span></u></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Coffee and homemade snacks are a good combination for people who want to eat light or are in a hurry </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A well-planned coffee shop business yields good profit.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">You have the freedom of using your creativity in your shop and food.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Homemade snacks and desserts are healthier and tastier options.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Huge capital is required.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The food and beverage provided should always be fresh. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Extra food cannot be stored for a long time.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">It is a time-consuming business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A team of hardworking and sincere people is required to make the business a success.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person venturing into the coffee shop business must be able to invest a lot of money initially. He/she should also have the creativity to keep innovating the business as per the need. A proper business plan with respect to advertising and marketing is essential to gain profit.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business is for people who have the passion to be their own boss, are ready to plunge into the market with a huge capital and emerge a winner with their creativity and hard work.<u></u></span></p>', 30, 1, 999999.99, 999999.99, 4, 700000.00, 999999.99, 3, 3, 4, 6, 2, '2018-11-22 22:59:28', '2019-03-18 18:20:15'),
(51, 'A small dairy farm to sell pure organic milk for personal and commercial use.', '<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Product/ service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Sell good quality organic milk to nearby homes and hotels. Sell the cow dung to people who make manure, compost or fuel out of it.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Market Scope /Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Milk forms the vital food component in each house, so dairy farm business has a good scope in the market if all the factors affecting it are controlled efficiently. Cow dung is also a great source of manure and fuel, if utilised in an eco-friendly way.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Milk is in good demand all over.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">It is an eco-friendly business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business suits both educated and uneducated people. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This is an old popular business of rural India, which is now having a good hold in urban India too.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business grows on its own when a new female calf is born.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The animals need proper care to prevent unnecessary infections.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Good quality fodder should be given to cows to keep them healthy and milk-producing for a long time.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper care should be given to the calves.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A lot of investment is required to start the business. A good working capital is also required to keep the business going.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A team of people is required to take care of the animals.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper cleanliness and hygiene should be maintained so that the cows are healthy and the milk produced is pure.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Entrepreneurial skills</span></u></strong><u></u></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who is starting the business should be well aware of the needs of animals. He/she should be trained in animal management. Availability of open land is also very important if one wants to start a dairy farm. The person should have good capital to invest during the initial phase of the business. The person should also be familiar with waste management so that all the waste produced can be efficiently channelized and used for the right purpose.</span></p>\r\n<p class=\"MsoNormal\"><strong xss=removed><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business is for people who love dealing with animals, have sufficient knowledge about the care of cows, have a lot of land and capital to invest and are ready to work hard and be disciplined.</span></p>', 3, 1, 700000.00, 999999.99, 4, 500000.00, 700000.00, 3, 2, 3, 23, 2, '2018-11-23 08:37:10', '2019-03-18 18:20:15');
INSERT INTO `ideas` (`id`, `idea_title`, `description`, `industry`, `currency`, `min_investment`, `max_investment`, `returns_type`, `min_returns`, `max_returns`, `breakeven_type`, `min_breakeven`, `max_breakeven`, `posted_by`, `status`, `created_at`, `updated_at`) VALUES
(52, 'Caters to the transportation needs of the medical organizations within the city. The service provided is very crucial and needs a mark of responsibility.', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/Service Description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>This business provides transportation/courier services to the medical organizations within the city. The business deals in the efficient and timely delivery of blood samples, patient reports, culture samples, donated organs, medicines</span><span lang=\"EN-US\" xss=removed>, vaccines, etc.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market Scope / Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Medical items often need special care while being transported from one location to another. Therefore, medical organizations only prefer to use quick, efficient and trusted courier services. Entering the field of medical courier services requires a great deal of responsibility, skill and knowledge. A business which provides quality services and understands the nuances of the medical field will definitely succeed and become the first choice of the medical organizations.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>There is great demand for good courier services that can provide quality services with efficiency.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The amount of capital required to start the business is low.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The profit margin is good.</span><span lang=\"EN-US\" xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The service requires a great deal of responsibility, as the medical items hold a lot of importance.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The person involved in the courier services must be aware of the general medical terminologies and requirements.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The vehicle used for transportation must be completely equipped to carry the crucial medical items in different kinds of conditions required. For eg. some samples require frozen temperature, while others need cold or normal temperature. There are some samples that are photosensitive and must be carried in complete darkness.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The driving skills of the driver must be flawless.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>All the people handling the medical items must be aware of the kinds of precautions to be taken.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>The business should be completely insured.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>All the people associated with the courier services must be properly trained about the medical items that they need to carry.</span><span lang=\"EN-US\" xss=removed> </span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial Qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Any person entering the business of medical courier services must be aware of the needs and precautions of handling the medical items. He/she should understand that their job needs a great deal of responsibility and efficiency. In addition, the person involved in the sales should have good contacts with medical organizations, health facilities and medical personnel to acquire more business deals.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Medical Courier business has a good demand if the services provided are fast and efficient. Good relationships with doctors, hospitals owners and other medical organizations will help to fetch more business opportunities.</span></p>', 36, 1, 800000.00, 999999.99, 4, 600000.00, 900000.00, 3, 1, 2, 2, 2, '2018-11-23 13:01:54', '2019-03-18 18:20:15'),
(53, 'Distribution of fast-moving consumer goods (FMCG) in wholesale and retail market.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business involves the wholesale distribution of FMCG products like biscuits, oil, soft drinks and bread to retail shops and other general customers.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Fast moving consumer goods are relatively low in price and used for regular consumption. There is a huge demand for such products as they are mostly the basic necessities of people. Any business dealing with the distribution of such commodities will do well if proper marketing is done.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The price of the commodities is low and they are sold rapidly, so they do not remain on the shelves for a long time.<u></u></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Easy to promote the business as the commodities are common. Special advertisements are not required.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Profit margin is high.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more, so it is important to make the business stand out by using creative methods.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">These are high volume commodities, so there has to be a proper place to store them.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The investment required is more.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Good networking is required to make the distribution business a success.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business does not need a person to possess any special skill. There is also no need to invest a large amount of money. A proper place to store the products and a good marketing plan is enough to enjoy a reasonable profit. </span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The business will do well because FMCG products are daily use commodities. However, since the competition is tough, a good marketing and innovative approach is required to make the business grow.<u></u></span></p>', 36, 1, 300000.00, 400000.00, 4, 300000.00, 400000.00, 2, 12, 18, 3, 2, '2018-11-23 21:10:12', '2019-03-18 18:20:15'),
(54, 'Starting toys’ import business that involves importing the toys from another country at a cheap price and reselling them in our country at a greater price.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>The business focuses on the import of toys from China and selling them to resellers (retailers or online sellers) in our country.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Now that the government has been supporting the growth of business in our country, one field that has been seeing a boom is the export and import business. With the advent of ecommerce, business has become easier than ever. Therefore, it is not surprising to see that very small entrepreneurs have also entered the field of export and import and are doing a great business. Importing toys from China and selling in our country has become very common. However, the business is still doing well, as the demand is growing continuously.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Initial investment is low. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Business has a huge potential of growth.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Business can yield good profit.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Business can also be started as a part-time job.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Advent of ecommerce has improved the scope of business.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Business must be registered and an IEC (Import and Export Code) must be obtained.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Sometimes there is a risk of loss of the products or the money due to transportation problems.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Import of the products needs a lot of formalities and paper work.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Customs duties need to be paid while receiving the products.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" xss=removed>Any person who wants to establish the business must prepare a proper business plan. He/she should be aware of the formalities required before starting the business. The person should also have good negotiation abilities to obtain the products at a good price. Good networking with resellers in our country will help in selling the imported products with ease.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>Import and export business is an excellent opportunity for people who want to earn good profit with less investment. Once the business person becomes accustomed with the entire process, the scope of growth is immense.</span></p>', 22, 1, 400000.00, 500000.00, 3, 30000.00, 40000.00, 2, 18, 24, 4, 2, '2018-11-24 07:02:33', '2019-03-18 18:20:15'),
(55, 'Manufacture different kinds of leather belts to be sold to wholesalers and retailers', '<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Product/service description</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>This business deals in the manufacture of various kinds on leather belts to be sold to retail shops and wholesalers. It aims at employing a few skilled and unskilled workers for this purpose.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Market scope/potential</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Belt is an important fashion accessory that is worn by people of all ages. The market today is flooded with a variety of belts available in different shapes, colors and designs. Though the competition in this field is more, the huge demand ensures that this business has good prospects if proper marketing strategies are used.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Huge demand for leather belts.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Investment required to start the business is less.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Manufacturing unit can be started in a small space.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Raw materials are very easily and abundantly available in India.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Skilled workers are available at low cost.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Competition is more so market strategies should be in place.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Registration and license are a must.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>There are many branded companies already ruling the market, so any small belt manufacturing unit must give special attention to the quality of its products and aim at building its own niche.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><strong><u><span lang=\"EN-US\" xss=removed>Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>A person planning to enter the belt manufacturing business must have the basic knowledge and training in the manufacturing process. A proper idea of the market is required to know about the competitors and the prevailing trends. The person should also have good contacts with leather manufacturing units to obtain the finest of leathers with ease. Contacts with retailers and wholesalers will enable the immediate sale of the finished product, thus enhancing the business.</span></p>\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed> </span><strong><u><span lang=\"EN-US\" xss=removed>Conclusion</span></u></strong></p>\r\n<p><span lang=\"EN-US\" xss=removed>This business can be started by any person who wants to earn a good profit by investing less amount of money. Though the demand is more and workers are easily available for the job, only a good market study will help to remain ahead and run a profitable business.</span></p>', 38, 1, 300000.00, 400000.00, 3, 30000.00, 50000.00, 2, 12, 18, 4, 2, '2018-11-24 20:35:09', '2019-03-18 18:20:15'),
(56, 'A unit to manufacture disposable syringe that can be supplied to various healthcare centers, wholesale suppliers, retail pharmacy shops and veterinary hospitals.', '<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Product/Service description</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A manufacturing unit that has all the equipment required to manufacture, sterilize, package, label, transport and store disposable syringe for the healthcare market.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Market Scope/Potential</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Ever since glass syringe has been replaced by plastic polypropylene syringe, it\'s demand has been on the rise. Since these syringes are disposable, all the healthcare centres need to replenish their stock from time to time. Therefore, syringe manufacturing business has a good potential in the healthcare market.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Opportunities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The demand of disposable syringe is huge.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Though there are a number of manufactures into this venture, eastern part of India still lacks syringe manufacturing units.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The manufacturers are usually involved in making low quality syringes for local use and high-quality syringes for export.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Risks</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Huge investment is required.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A big team of professionals and workers are required.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper storage facilities are needed.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Competition is more.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Entrepreneurial qualities</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A person who wants to dive into syringe manufacturing business should have an experience in the manufacturing of medical equipment. He/she should also have good managerial skills to control a big team of people. The person should be ready to make huge investments. Marketing strategies should also be up to the mark.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Dos</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">A license is required before starting the business.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Proper sterilization of the syringe is necessary before transporting it to the market.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Visit an existing manufacturing unit to get more idea about the entire process.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Don\'ts</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Don\'t compromise on the quality of the manufacturing machines and processes, as it can put a lot of people into health risk.</span></p>\r\n<p class=\"MsoNormal\"><strong><u><span lang=\"EN-GB\">Conclusion</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">This business is for people who have a financially strong background and a previous experience in the field of manufacturing of healthcare equipment.<span xss=removed>  </span>They should also be able to manage a big team of people and should be dedicated enough to produce good number of products each day without compromising on the quality.</span></p>', 42, 1, 999999.99, 999999.99, 4, 999999.99, 999999.99, 3, 3, 4, 3, 2, '2018-11-25 06:23:10', '2019-03-18 18:20:15'),
(58, 'Providing latest corporate training to the employees and help them to perform better in their organizations.', '<p><strong>Product/service description</strong></p>\r\n\r\n<p>This business focuses on providing corporate training to the employees in various fields and helping them to enhance their skills.</p>\r\n\r\n<p><strong>Market Scope/Potential</strong></p>\r\n\r\n<p>Corporate training has become the buzzword. With the introduction of artificial intelligence, training and development have become more important than ever. It is a truth that only a well-trained employee can prove to be an asset to the company. Every employee wishes to make an effort to enhance his/her skills. The companies too are hiring professional trainers to train their employees on a regular basis. Looking at the need of the market, starting an employee training business is an excellent idea.</p>\r\n\r\n<p><strong>Opportunities</strong></p>\r\n\r\n<ol>\r\n <li>There is a huge demand for training the employees.</li>\r\n <li>Though there is a lot of competition in the market, very few of the trainers provide good services.</li>\r\n <li>It is a great opportunity for people who have mastered a field and want to help others by sharing their knowledge.</li>\r\n <li>The business yields a good profit.</li>\r\n</ol>\r\n\r\n<p><strong>Risks</strong></p>\r\n\r\n<ol>\r\n <li>The investment required is relatively more.</li>\r\n <li>The person starting the business must hire other skilled trainers.</li>\r\n <li>The business requires a lot of hard work.</li>\r\n <li>The trainers need to be up-to-date with all the recent happenings in the corporate world.</li>\r\n <li>The success of the business depends on the creation of unique training models that must be better than what the competitors are offering.</li>\r\n</ol>\r\n\r\n<p><strong>Entrepreneurial qualities</strong></p>\r\n\r\n<p>Any person wanting to start an employee training business must have an experience in the corporate field and a proficiency in the subject that he/she wants to train. Good networking with corporate organizations, smart marketing skills and unique training models can help any businessperson to grow in this field.</p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>Employee training business is an emerging field and with the continuous development in the corporate world, the need to train the employees is never going to cease.</p>\r\n', 19, 1, 700000.00, 800000.00, 3, 40000.00, 50000.00, 3, 2, 3, 6, 2, '2018-11-26 06:07:00', '2019-03-18 18:20:15'),
(59, 'A small home-based nursery to sell plants, seeds, fertilizers, pesticides, gardening soil, compost, gardening tools and accessories, decorative pots', '<p><strong>Product/service description</strong><br>\r\n<br>\r\nSell a variety of plants that can be grown in pots, seeds of vegetables and flowering plants, organic fertilizers, pesticides, gardening soil mix, homemade compost, decorative pots, gardening tools and accessories. The business will focus on the gardening requirements of apartments, offices and other small spaces.</p>\r\n\r\n<p><br>\r\n<strong>Market Scope/ Potential</strong><br>\r\n<br>\r\nThese days, as the environment is degrading, growing plants has become a necessity. However, not everyone has a big land to grow trees. People living in apartments and small spaces need plants that can easily be grown in pots and require less effort and maintenance. Therefore, a nursery which specialises in selling plants and other materials mostly suitable for small balconies can flourish easily. Homemade compost is again an elixir for the plants. A nursery that sells genuine homemade compost can make huge profits.<br>\r\n<br>\r\n<strong>Opportunities</strong><br>\r\n<br>\r\n1. The competition is less. Though there are nurseries selling plants and other stuffs, they generally focus on big gardens. Nurseries focusing only on potted plants and small spaces plants are less. Moreover, the supermarkets that sell plants and garden accessories are very costly and not many people can afford them.<br>\r\n<br>\r\n2. Not many nurseries sell vegetable seeds that can easily grow in pots. <br>\r\n<br>\r\n3. The investment is less and nursery can be easily started if one has a little backyard space.<br>\r\n<br>\r\n4. Initially, the plants can be bought from a whole seller, but later the many of them can be easily propagated at home.<br>\r\n<br>\r\n5. Organic compost can easily be made at home by just using kitchen scraps.<br>\r\n<br>\r\n<strong>Risks</strong><br>\r\n<br>\r\n1. Some plants need special care and can die if proper conditions are not given.<br>\r\n<br>\r\n2. Watering and fertilizing of plants are necessary and one has to do it diligently.<br>\r\n<br>\r\n3. The soil of the pots gets dried up very easily during summer months.<br>\r\n<br>\r\n4. There should be a proper place to store decorative pots and garden accessories, otherwise there is a chance of them being spoilt.<br>\r\n<br>\r\n5. Plants take time to grow so immediate huge demand of a particular plant cannot be fulfilled.<br>\r\n<br>\r\n6. Homemade compost takes about three months to be completely formed, so the production takes time.<br>\r\n<br>\r\n7. Seeds can be spoilt by worms if they are not stored properly.<br>\r\n<br>\r\n8. Plants can be attacked by pests.<br>\r\n<br>\r\n<strong>Entrepreneurial qualities</strong><br>\r\n<br>\r\nTo start a nursery one does not need any specific qualities. Anyone can start a nursery, if he/she owns a land and knows a little about the care of plants, composting, making soil mix and propagating. However, a lot of hard work and discipline is required. A little planning is also required to sort out details like where to buy the wholesale stock from, where to store the surplus products, how to attract the customers and how to aesthetically present the products so that people are encouraged to buy them.<br>\r\n<br>\r\n<strong>Do&#39;s</strong><br>\r\n<br>\r\n1. All the plants should be properly watered and fertilized.<br>\r\n<br>\r\n2. Store all the seeds, pots and tools in a proper place.<br>\r\n<br>\r\n3. Propagation of plants and preparation of compost should be planned well in advance so that the stock is always ready to sell.</p>\r\n\r\n<p><br>\r\n<strong>Don&#39;t</strong></p>\r\n\r\n<p>1. Don&#39;t buy too many plants at a time. Look at the sale and then decide.<br>\r\n<br>\r\n<strong>Conclusion</strong></p>\r\n\r\n<p>This business is for people who have a little land or backyard space, zeal to work with plants, motivation to remain disciplined and business skills to sell the products.</p>\r\n', 3, 1, 30000.00, 40000.00, 3, 10000.00, 20000.00, 2, 6, 12, 6, 2, '2018-11-27 20:59:54', '2019-03-18 18:20:15'),
(60, 'A sports shop to sell different kinds of sports items. The shop will sell the items individually for personal use and in bulk for different organizations', '<p><strong>Product/ service description :</strong></p>\r\n\r\n<p>A retail sports shop that sells a variety of sports goods and accessories useful for sportsmen, students and professionals. The shop also supplies sports goods to schools, colleges and other organizations.</p>\r\n\r\n<p><strong>Market Scope/ Potential :</strong></p>\r\n\r\n<p>There&#39;s an evergreen scope in the field of sports. A vast number of people play some kind of sports either on a professional level or in the form of a hobby. Children need sports goods to play and practice. Schools and colleges too need a regular supply of sports items. A good sports shop that sells quality goods will be able to make a reasonable profit.</p>\r\n\r\n<p><strong>Opportunities :</strong></p>\r\n\r\n<p>1. Sports market is vast and there is a good business opportunity for everyone who enters the field.</p>\r\n\r\n<p>2. Good quality of sports items are always in huge demand.</p>\r\n\r\n<p>3. If the shop is at a good location and the marketing is done strategically, the business will surely be profitable.</p>\r\n\r\n<p>4. There&#39;s always a scope for the business to grow.</p>\r\n\r\n<p><strong>Risks :</strong></p>\r\n\r\n<p>1. Good investment is required.</p>\r\n\r\n<p>2. The business greatly depends on the location of the shop.</p>\r\n\r\n<p>3. Competition is more, so marketing strategies need to be in place.</p>\r\n\r\n<p>4. Big brands have come up in the market so small retail shops need effective advertising and good interpersonal relationships to survive in the market.</p>\r\n\r\n<p>5. The retail shop needs a reliable wholesale supplier or manufacturer who can supply all the necessary goods at a reasonable price.</p>\r\n\r\n<p><strong>Entrepreneurial qualities :</strong></p>\r\n\r\n<p>This business does not require any special skills, however, anyone entering into the sports shop business must be able to invest a lot of money. He/she must be aware of the current market scenario in order to make effective marketing strategies. Good relationships with schools and colleges can fetch bulk orders.</p>\r\n\r\n<p><strong>Conclusion:</strong></p>\r\n\r\n<p>A sports shop business has a good scope in the market if the location of the shop is good, the quality of the items are acceptable and creative marketing strategies are in place.</p>\r\n', 66, 1, 999999.99, 999999.99, 4, 700000.00, 800000.00, 3, 2, 3, 6, 2, '2018-11-29 21:16:34', '2019-03-18 18:20:15'),
(61, 'Collect scrap steel from various places, process it, transform it into new products and sell them.', '<p><strong>Product/Service Description</strong></p>\r\n\r\n<p>This is a recycling business that involves collecting scrap steel from various places like manufacturing sites, construction areas and places where waste is collected. This scrap steel is then processed in the factory and transformed into new products that are again sold in the market.</p>\r\n\r\n<p><strong>Market Scope/Potential</strong></p>\r\n\r\n<p>Metal recycling is a huge business in India. It provides employment to a large part of our population. Though the establishment of this business requires a bulky capital as well as the engagement of a large number of people, the finished goods earn a good profit in the market. With correct market research, this profit can be grown continuously, and the business can flourish extensively.</p>\r\n\r\n<p><strong>Opportunities</strong></p>\r\n\r\n<p>1.      Huge availability of raw materials (scrap steel).</p>\r\n\r\n<p>2.      The scrap steel is available at a very low price or, in some cases, almost for free.</p>\r\n\r\n<p>3.      The finished products (steel products) are sold at a good price, thus yielding enormous profit.</p>\r\n\r\n<p>4.      Around 40% of steel material is made from recycled steel.</p>\r\n\r\n<p>5.      Metal recycling helps in cleaning the environment.</p>\r\n\r\n<p><strong>Risks</strong></p>\r\n\r\n<p>1.      The scrap steel must be handled with care, as they are potentially dangerous and can cause physical ailments.</p>\r\n\r\n<p>2.      All the employees should be insured, as the work involves dangers to health.</p>\r\n\r\n<p>3.      Collecting Scrap steel from all the places must be managed efficiently and in a cost-effective way.</p>\r\n\r\n<p>4.      The business must be registered.</p>\r\n\r\n<p>5.      Huge capital is required to establish the business.</p>\r\n\r\n<p><strong>Entrepreneurial qualities</strong></p>\r\n\r\n<p>Specific skill is not required for this business, but any person wishing to enter this field must develop good contacts with industries and places that can provide scrap steel (raw material) in bulk at a reasonable price. Good marketing skill is also required to sell the finished products at a profitable price.</p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>Though the recycling business is not regarded as a top-class business, it does have its own benefits. It helps to clean the environment by utilizing the waste metal. It also contributes in providing employment to many people. It gives the business person an opportunity to earn good profit.</p>\r\n', 65, 1, 999999.99, 999999.99, 4, 700000.00, 999999.99, 3, 2, 4, 6, 2, '2018-11-30 23:03:52', '2019-03-18 18:20:15'),
(63, 'Manufacturing different flavors of ice creams in a small-scale manufacturing unit.', '<p><strong>Product/ service description</strong></p>\r\n\r\n<p>Manufacturing different flavours of ice cream in a small-scale manufacturing unit on available land of around 1000 sq ft. This ice cream is supplied to whole sellers, retailers and mobile ice cream carts.</p>\r\n\r\n<p><strong>Market Scope/ Potential</strong></p>\r\n\r\n<p>Ice creams have become a staple dessert in our country. It is equally enjoyed by people of all ages. There is a huge demand for ice creams in the market. According to the market experts, this demand is going to increase further. Therefore, a small-scale ice cream manufacturing business is a good idea to make profit.</p>\r\n\r\n<p><strong>Opportunities</strong></p>\r\n\r\n<p>1. There is huge demand for ice creams.</p>\r\n\r\n<p>2. The ice creams can be made interesting by introducing new flavours, colours, shapes and sizes.</p>\r\n\r\n<p>3. Summer season is a good time to make some extra profit, as the demand increases a lot.</p>\r\n\r\n<p>4. The business is highly profitable.</p>\r\n\r\n<p>5. All the raw materials are easily available.</p>\r\n\r\n<p><strong>Risks</strong></p>\r\n\r\n<p>1. Investment required to start the business is more.</p>\r\n\r\n<p>2. License and registration is a must before starting the business.</p>\r\n\r\n<p>3. The land where the manufacturing unit has to be established must be in a clean hygienic area, as the business is dealing with food products.</p>\r\n\r\n<p>4. Competition is more so marketing strategies need to be innovative.</p>\r\n\r\n<p>5. The raw materials used are highly perishable, so they have to stored under proper conditions.</p>\r\n\r\n<p><strong>Entrepreneurial qualities</strong></p>\r\n\r\n<p>Any person interested in starting the business should have a large amount of capital to invest. He/she should also have an idea of the market competitors. Proper marketing strategies can help the business to grow by overcoming all the obstacles.</p>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>Ice cream making business is a good opportunity for people who would love to take a plunge in an already flooded market. This business can be a huge success by introducing innovative marketing strategies.</p>\r\n', 26, 1, 999999.99, 999999.99, 4, 999999.99, 999999.99, 3, 2, 3, 352, 2, '2018-12-04 21:23:48', '2019-03-18 18:20:15'),
