(66, 'Development', '<p>The Director of Development is responsible for planning, organizing, and directing all &nbsp;fundraising including, the major gifts program, annual fund, planned giving, special events and capital campaigns.&nbsp; The Director works closely with The Executive Director and the Board of Directors in all development and fund raising endeavors.&nbsp;<strong>&nbsp;</strong></p>\r\n\r\n<p><strong>QUALIFICATIONS:</strong></p>\r\n\r\n<ul>\r\n	<li>Strong interpersonal and writing skills.</li>\r\n	<li>Have knowledge and experience in fund raising techniques, particularly major gift fundraising.</li>\r\n	<li>Possess the skills to work with and motivate staff, board members and other volunteers.</li>\r\n	<li>Have the desire to get out of the office and build external relationships.</li>\r\n	<li>Be a &ldquo;self-starter&rdquo; and goal driven to initiate donor visits and fundraising calls.</li>\r\n	<li>Be organized and exhibit &ldquo;follow through&rdquo; on tasks and goals.</li>\r\n	<li>Display a positive attitude, show concern for people and community, demonstrate presence, self-confidence, common sense and good listening ability.</li>\r\n	<li>A bachelor&rsquo;s degree.</li>\r\n	<li>5 years minimum experience in professional fundraising.</li>\r\n</ul>\r\n', 9, 0, 10.00, 12.00, 0, 1.00, 2.00, 0, 1, 2, 220, 1, '2019-05-24 13:01:27', '2019-05-24 13:01:27'),
