(69, 'Software Developer', '<p>Job description is an informative documentation of the scope, duties, tasks, responsibilities and working conditions related to the job listing in the organization through the process of job analysis. Job Description also details the skills and qualifications that an individual applying for the job needs to possess. It basically gives all the details which might be good for both the company and the applicant so that both parties are on the same page regarding the job posting.&nbsp;Basically,&nbsp;<strong>job analysis</strong>&nbsp;is bifurcated into two components namely job description and&nbsp;<strong>job specification</strong>.</p>\r\n\r\n<p>Steps to Write a Job Description</p>\r\n\r\n<p>Companies have to make sure that they write an accurate &amp; comprehensive job description giving all job-related details. The main steps to write a job description are:</p>\r\n\r\n<p>1.&nbsp;<strong>Job Title:&nbsp;</strong>The first step in writing the job description is to write the job title decided internally for official purposes.</p>\r\n\r\n<p>2.&nbsp;<strong>Role Summary:</strong>&nbsp;The second step in writing the job description is to write the summary about the job role.</p>\r\n\r\n<p>3.&nbsp;<strong>Duties:</strong>&nbsp;The next step involves writing down all the job responsibilities as well as the job duties which are required with this particular job.</p>\r\n\r\n<p>4.&nbsp;<strong>Qualifications:</strong>&nbsp;The fourth step in writing the job description is to give the basic education qualifications, work experience or other criteria required for this job role.</p>\r\n\r\n<p>5.&nbsp;<strong>Role Expectations:</strong>&nbsp;This step defines what is required by an employee to be successful.</p>\r\n\r\n<p>6.&nbsp;<strong>Reporting:</strong>&nbsp;The sixth step in writing a good job description is to highlight who the reporting manager would be and who would be the subordinates.</p>\r\n\r\n<p>7.&nbsp;<strong>Verification:</strong>&nbsp;The final step is to get the job description verified by the HR team for any changes, updates or validations.</p>\r\n', 4, 0, 1.00, 20.00, 0, 1.00, 20.00, 0, 1, 20, 221, 1, '2019-06-06 16:21:56', '2019-06-06 16:21:56'),
(70, 'testing', '<p>9963929142</p>\r\n', 7, 0, 12.00, 12.00, 0, 12.00, 12.00, 0, 12, 12, 218, 1, '2019-06-11 15:31:39', '2019-06-11 15:31:39'),
(71, 'Description', '<p>57834785467</p>\r\n', 5, 0, 12.00, 12.00, 0, 12.00, 12.00, 0, 12, 12, 218, 1, '2019-06-11 15:38:03', '2019-06-11 15:38:03'),
(72, 'Manufacturer', '<p>Manufacturing is the making of goods by hand or by machine that upon completion the business sells to a customer. Items used in manufacture may be raw materials or component parts of a larger product. The manufacturing usually happens on a large-scale production line of machinery and skilled labor.</p>\r\n\r\n<p>Types of Manufacturing Processes</p>\r\n\r\n<p>Manufacturing is a very simple business; the owner buys the raw material or component parts to manufacture a finished product. To function as a business the manufacturer needs to cover costs, meet demand and make a product to supply the market.</p>\r\n\r\n<p>A factory operates one of three types of manufacturing production:</p>\r\n\r\n<ul>\r\n	<li><strong>Make-To-Stock (MTS)</strong>&nbsp;&ndash; A factory produces goods to stock stores and showrooms. By predicting the market for their goods, the manufacturer will plan production activity in advance. If they produce too much they may need to sell surplus at a loss and in producing too little they may miss the market and not sell enough to cover costs.</li>\r\n	<li><strong>Make-To-Order (MTO)</strong>&nbsp;&ndash; The producer waits for orders before manufacturing stock. Inventory is easier to control and the owner does not need to rely as much on market demand. Customer waiting time is longer though and the manufacturer needs a constant stream of orders to keep the factory in production.</li>\r\n	<li><strong>Make-To-Assemble (MTA)</strong>&nbsp;&ndash; The factory produces component parts in anticipation of orders for assembly. By doing this, the manufacturer is ready to fulfil customer orders but if orders do not materialize, the producer will have a stock of unwanted parts.</li>\r\n</ul>\r\n', 7, 0, 50.00, 100.00, 0, 100.00, 500.00, 0, 1000, 2000, 218, 1, '2019-06-17 21:22:10', '2019-06-17 21:22:10'),
(73, 'testing', '<p>Job description is an informative documentation of the scope, duties, tasks, responsibilities and working conditions related to the job listing in the organization through the process of job analysis. Job Description also details the skills and qualifications that an individual applying for the job needs to possess. It basically gives all the details which might be good for both the company and the applicant so that both parties are on the same page regarding the job posting.&nbsp;Basically,&nbsp;<strong>job analysis</strong>&nbsp;is bifurcated into two components namely job description and&nbsp;<strong>job specification</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The job description is used in the recruitment process to inform the applicants of the job profile and requirements, and used at the performance management process to evaluate the employee&rsquo;s performance against the description.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Importance of Job Description</p>\r\n\r\n<p>Job description is the most important thing which a candidate gets about a job listing. Job description gives all the relevant and necessary details about a job. The details which can help one decide whether the job is relevant or not. Qualifications, roles, responsibilities etc are included in the job description document which paints a clear picture of what is expected from the particular role.</p>\r\n\r\n<p>Job description gives an opportunity for a candidate to prepare well for a job interview. It also helps companies identify all skills required by a right candidate.</p>\r\n\r\n<p>A Job description will include the following components:</p>\r\n\r\n<p>- Roles and responsibilities of the job.</p>\r\n\r\n<p>- Goals of the organization as well the goals to be achieved as a part of the profile are mentioned in the job description.</p>\r\n\r\n<p>- Qualifications in terms of education and work experience required have to be clearly mentioned.</p>\r\n\r\n<p>- Skill sets like&nbsp;<strong>leadership</strong>,&nbsp;<strong>team management</strong>,&nbsp;<strong>time management</strong>, communication management etc required to fulfill the job</p>\r\n\r\n<p>- Salary range of the job are mentioned in the job description</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Job Description Sample</p>\r\n\r\n<p>A typical job description would have job title followed by summary. After these, there could be a detailed description of the role.</p>\r\n', 59, 0, 100.00, 200.00, 0, 100.00, 200.00, 0, 100, 200, 218, 1, '2019-06-25 12:18:06', '2019-06-25 12:18:06'),
(74, 'Gaining', '<p>Compliance gaining occurs whenever a person intentionally induces another person to do something that they might have not done otherwise.[1]&nbsp;Compliance gaining and persuasion are related; however, they are not one and the same. Changes in attitudes and beliefs are often the goal in persuasion; compliance gaining seeks to change the behavior of a target. It is not necessary to change a person&#39;s attitude or beliefs to gain compliance. For instance, an automobile driver might have positive attitudes towards driving fast. The threat of a speeding ticket from a police officer positioned in a speed trap may gain compliance from the driver. Conversely, persuading someone to change their attitude or belief will not necessarily gain compliance. A doctor might tell a patient that tobacco use poses a serious threat to a smoker&#39;s health. The patient may accept this as a fact and view smoking negatively, but might also continue to use tobacco.</p>\r\n\r\n<p>Compliance gaining research has its roots in social psychology, but overlaps with many other disciplines such as communication and sociology. Compliance gaining can occur via mediated channels, but the research is most associated with interpersonal communication.[1]&nbsp;In 1967,[2]&nbsp;sociologists Marwell and Schmitt attempted to explain how people select compliance gaining messages.[3]&nbsp;The researchers posited that people have a mental bank of strategies that they draw from when selecting a message.[4]&nbsp;Marwell and Schmitt created a typology for compliance gaining techniques: promise, threat, positive expertise, negative expertise, liking, pregiving, aversive stimulation, debt, moral appeal, positive self-feeling, negative self-feeling, positive altercasting, negative altertcasting, altruism, positive esteem, and negative esteem.[5]This study was the catalyst for more interest in compliance gaining from communication scholars.</p>\r\n\r\n<p>Miller, Boster, Roloff, and Seibold (1977)[6]&nbsp;as well as Cody and McLaughlin (1980)[7]&nbsp;studied the situational variables that influences compliance gaining strategies. The latter study identified six different typologies of situations that can influence compliance gaining behaviors: personal benefits (how much personal gain an actor can yield from the influencing behavior), dominance (the power relation between the actor and the target), rights (whether the actor has the right to expect compliance), resistance (how easy will the target be influenced), intimacy (whether the relation between actor and target is shallow), and consequences (what sort of effect this situation would have on the relationship between actor and target). Dillard and Burgoon (1985)[3]&nbsp;later investigated the Cody-McLaughlin typologies. They concluded that situational variables, as described by Cody and McLaughlin, did very little to predict compliance gaining strategy selection. As early as 1982, there was already strong criticism about the strength of the relationships between situational variables and compliance gaining message selection.[8]</p>\r\n\r\n<p>By the 1990s, many research efforts attempting to link compliance gaining strategy selection and features of a situation or features of the individual &quot;failed to coalesce into a coherent body of knowledge&quot;.[9]&nbsp;Situational dimensions and individual differences were not effective in predicting so researchers went into other perspectives in an effort to understand compliance gaining.[9]&nbsp;For instance, Schrader and Dillard (1998)[9]&nbsp;linked primary and secondary goals to compliance gaining strategy. Using the theoretical framework of Goals-Plans-Actions developed by Dillard in 1980, Schrader and Dillard operate from the assumption that individuals possess and act on multiple goals. In any compliance seeking situation, the actor has primary goals that drive the attempt to influence a target. The primary goal is what the interaction is all about. For instance, if an actor wants a target to stop smoking, this is the primary goal and this is what drives the interaction. However, in the course of pursuing that goal, there are &quot;secondary&quot; goals to consider. These are goals that limit the behavior of the actor. If getting a target to stop smoking is the primary goal, then a secondary goal might be to maintain a friendly relationship with the target. Dillard specifies five types of secondary goals that temper the compliance gaining behavior: identity goals (morals and personal standards), interaction goals (impression management), relational resource goals (relationship management), personal resource goals (material concerns of the actor), and arousal management goals (efforts to manage anxiety about the compliance gaining attempt).[9]</p>\r\n\r\n<p>Despite the charges of individual differences making very little progress in prediction compliance gaining strategies, some researchers in the 2000s have focused their efforts to rectify this weakness in the research to link individual differences with compliance gaining effectiveness. King (2001),[10]&nbsp;acknowledging the paucity of robust situational and trait studies linked to compliance gaining, attempted to isolate one situation as a predictor for compliance gaining message selection. King&#39;s research suggested that when target of compliance gaining were perceived to be less resistant to influence attempts, the actors used more compliance gaining tactics. When targets were perceived as strongly resistant, the actors used less tactics. Elias and Loomis (2004)[11]&nbsp;found that gender and race affect an instructor&#39;s ability to gain compliance in a college classroom. Punyanunt (2000)[12]&nbsp;found that using humor may enhance the effectiveness of pro-social compliance gaining techniques in the classroom. Remland and Jones (1994)[13]&nbsp;found that vocal intensity and touch also affect compliance gaining. Goei et al. (2003)[14]&nbsp;posited that &quot;feelings of liking&quot; between target and actor as well as doing favors for the target lead to liking and obligation, which leads to increased compliance. Pre-giving (giving a target a small gift or favor such as a free sample of food) is positively associated with increased compliance in strangers.[15]&nbsp;One of the major criticisms of examining compliance gaining literature is that very little research studies actual compliance.[16]&nbsp;Filling out a survey and reporting intent to comply with a request is certainly different than actually completing the request. For example, many people might report that they will comply with a doctor&#39;s order, but away from the doctor&#39;s office, they may ignore medical advice.</p>\r\n', 4, 0, 100.00, 200.00, 0, 100.00, 200.00, 0, 100, 200, 218, 1, '2019-06-25 17:03:27', '2019-06-25 17:03:27'),
