(3, 'Agriculture/Dairy', 'agriculture-dairy', '<div class=\"container footer-top \">\r\n    <div class=\"row\">\r\n        <div class=\"col-md-12 panel-body\">\r\n            <h2>Agriculture Business Ideas</h2>\r\n            <p>Agriculture is a flourishing; and it is flourishing fast! With new technology-based agricultural business ideas, many entrepreneurs are transforming this sector into a money-making opportunity. Agriculture is therefore, not just biased towards traditional ways of farming anymore; rather the ‘new gold’ today is, to make this sector the most profitable revenue making business idea with the lowest investment possible in India.</p>\r\n            <p><a href=\"https://www.viewham.com\">Viewham</a> – comes to you as the only platform where you can turn an idea into profitable business in no time! We have all the resources a modern entrepreneur would need to make the most of their agricultural business ideas. </p>\r\n            <h3>Most Profitable Agriculture Business Ideas </h2>\r\n            <p>All you need to do is:</p>\r\n            <ul>\r\n                <li>Create an account </li>\r\n                <li>Navigate to the tab named, ‘Idea Zone’</li>\r\n                <li>Summarize your idea in the canvas space provide to post your agricultural business idea</li>\r\n            </ul>\r\n            \r\n            <p>And that’s about it! <br>\r\n            With these three steps, you now have access to the Viewham Universe. Interested users will contact you to take the idea forward.</p>\r\n            \r\n            <p>View from hundreds of different  agricultural <a class=\"spark\" href=\"https://www.viewham.com/businessideas/\">business startup ideas </a> and plans that are posted in the site. You could add-on to contribute to the same.</p>\r\n        </div>\r\n    </div>\r\n</div>', 2, '2019-03-10 10:25:41', '2019-03-10 10:25:41'),
