(14, 2, '<p>The job description is informative documentation of the scope, duties, tasks, responsibilities and working conditions related to the job listing in the organization through the process of job analysis. Job Description also details the skills and qualifications that an individual applying for the job needs to possess. It basically gives all the details which might be good for both the company and the applicant so that both parties are on the same page regarding the job posting.&nbsp;Basically,&nbsp;<strong>job analysis</strong>&nbsp;is bifurcated into two components namely job description and&nbsp;<strong>job specification</strong>.</p>\r\n', '{\"1\":\"Valencia, Spain\",\"2\":\"Val\\u00e8ncia, Spain\"}', 0, 1, 'INR', 1, 2, 218, 1, 10, 1, 2, 1, '2019-05-27 09:03:39', '2019-05-27 09:03:21', '2019-05-27 09:03:39'),
(15, 2, '<p>The job description is the most important thing which a candidate gets about a job listing. The job description gives all the relevant and necessary details about a job. The details which can help one decide whether the job is relevant or not. Qualifications, roles, responsibilities, etc are included in the job description document which paints a clear picture of what is expected from the particular role.</p>\r\n', '{\"1\":\"Valencia, Spain\",\"2\":\"Val\\u00e8ncia, Spain\"}', 0, 2, 'INR', 1, 2, 218, 1, 10, 1, 4, 2, '2019-05-27 09:08:01', '2019-05-27 09:05:05', '2019-05-27 09:08:01'),
