(18, 2, '<p>Steps to Write a Job Description</p>\r\n\r\n<p>Companies have to make sure that they write an accurate &amp; comprehensive job description giving all job-related details. The main steps to write a job description are:</p>\r\n\r\n<p>1.&nbsp;<strong>Job Title:&nbsp;</strong>The first step in writing the job description is to write the job title decided internally for official purposes.</p>\r\n\r\n<p>2.&nbsp;<strong>Role Summary:</strong>&nbsp;The second step in writing the job description is to write the summary about the job role.</p>\r\n\r\n<p>3.&nbsp;<strong>Duties:</strong>&nbsp;The next step involves writing down all the job responsibilities as well as the job duties which are required with this particular job.</p>\r\n\r\n<p>4.&nbsp;<strong>Qualifications:</strong>&nbsp;The fourth step in writing the job description is to give the basic education qualifications, work experience or other criteria required for this job role.</p>\r\n\r\n<p>5.&nbsp;<strong>Role Expectations:</strong>&nbsp;This step defines what is required by an employee to be successful.</p>\r\n\r\n<p>6.&nbsp;<strong>Reporting:</strong>&nbsp;The sixth step in writing a good job description is to highlight who the reporting manager would be and who would be the subordinates.</p>\r\n\r\n<p>7.&nbsp;<strong>Verification:</strong>&nbsp;The final step is to get the job description verified by the HR team for any changes, updates or validations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Advantages of Job Description</p>\r\n\r\n<p>There are many benefits of having a comprehensive job description given by a company. Some of the advantages of job description are mentioned below:</p>\r\n\r\n<p>1. Helps companies understand the type of candidate they should search for based on title, position and location</p>\r\n\r\n<p>2. Employees are well aware about their job roles &amp; duties</p>\r\n\r\n<p>3. Job description helps in understanding the workplace environment, benefits etc for a prospective employee</p>\r\n\r\n<p>4. Helps in better recruitment &amp; selection</p>\r\n\r\n<p>5. Job description clearly highlights all the requirements, objectives &amp; goals that it wants an employee to perform</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Disadvantages of Job Description</p>\r\n\r\n<p>Despite being a thorough documentation related to the job, there are certain limitation of job description:</p>\r\n\r\n<p>1. Job descriptions are time bound and can change with organization structure, industry policies, company requirements etc</p>\r\n\r\n<p>2. It can only highlight the macro criteria of a job but cannot fully explain the obstacles, emotional requirements etc related to the job</p>\r\n\r\n<p>3. Incomplete job description lacking quality information can misguide both the HR manager as well as the employee</p>\r\n', '[\"Springfield, MO, USA\"]', 1, 3, 'USD', 12, 16, 218, 2, 10, 1, 40, 20, '2019-06-24 04:54:19', '2019-06-24 04:54:13', '2019-06-24 04:54:19'),
