(28, 1, '<p>According to Torrington, a job description is usually developed by conducting a&nbsp;job analysis, which includes examining the tasks and sequences of tasks necessary to perform the job. The analysis considers the areas of&nbsp;knowledge,&nbsp;skills, and&nbsp;abilities&nbsp;needed to perform the job. Job analysis generally involves the following steps: collecting and recording job information; checking the job information for accuracy; writing job descriptions based on the information; using the information to determine what skills, abilities, and knowledge are required to perform the job; updating the information from time to time.</p>\r\n', '[\"\",\"Vizag, Andhra Pradesh, India\"]', 'INR', 12, 14, 'Days', 12, 13, 218, 6, 1, 1, '2019-05-27 10:31:05', 1, '2019-05-27 10:31:05', '2019-05-27 10:30:56'),
