(38, 4, '<p>Compliance gaining occurs whenever a person intentionally induces another person to do something that they might have not done otherwise.[1]&nbsp;Compliance gaining and persuasion are related; however, they are not one and the same. Changes in attitudes and beliefs are often the goal in persuasion; compliance gaining seeks to change the behavior of a target. It is not necessary to change a person&#39;s attitude or beliefs to gain compliance. For instance, an automobile driver might have positive attitudes towards driving fast. The threat of a speeding ticket from a police officer positioned in a speed trap may gain compliance from the driver. Conversely, persuading someone to change their attitude or belief will not necessarily gain compliance. A doctor might tell a patient that tobacco use poses a serious threat to a smoker&#39;s health. The patient may accept this as a fact and view smoking negatively, but might also continue to use tobacco.</p>\r\n\r\n<p>Compliance gaining research has its roots in social psychology, but overlaps with many other disciplines such as communication and sociology', '[\"Detroit, MI, USA\"]', 'INR', 100, 200, 'Days', 100, 200, 218, 6, 10, 10, '2019-06-25 10:57:10', 1, '2019-06-25 10:57:10', '2019-06-25 10:56:45'),
(39, 1, '<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n', '[\"Hyderabad, Telangana, India\"]', 'INR', 12, 21, 'Months', 12, 13, 1, 6, 50, 50, '2019-07-19 12:21:17', 1, '2019-07-19 12:21:17', '2019-07-19 12:21:12');
